import React from 'react'

const Navbar = props => {
  const count = props.count
  const plural = () => (count === 1 ? 'item' : 'items')
  return (
    <nav>
      <h1>To-Do</h1>
      <strong>{`${count} ${plural} left`}</strong>
    </nav>
  )
}

export default Navbar
